var title_f20_57_21404="Lab findings TTP HUS";
var content_f20_57_21404=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F63416&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F63416&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Laboratory findings in thrombotic thrombocytopenic purpura hemolytic uremic syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Complete blood count",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Anemia (microangiopathic hemolytic anemia)",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Thrombocytopenia",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased reticulocyte percentage",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        White blood cell count normal to increased",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        White blood cell differential normal with no immature granulocytes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Peripheral blood smear",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Polychromatophilic red cells (ie, reticulocytosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Fragmented red cells (schistocytes, helmet cells)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Nucleated red cells may be present, but are not numerous*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Coagulation and Immunohematologic studies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Normal PT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Normal aPTT",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fibrinogen concentration normal&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fibrin degradation products not increased&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Direct Coombs' test negative",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Other laboratory studies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Markedly increased serum lactate dehydrogenase (LDH)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased serum indirect bilirubin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Markedly reduced or absent serum haptoglobin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serum creatinine may be increased&nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Although all of the findings listed here may be present, the diagnosis of TTP-HUS should be suspected in any patient with otherwise unexplained microangiopathic hemolytic anemia and thrombocytopenia.",
"    <div class=\"footnotes\">",
"     TTP: Thrombotic thrombocytopenic purpura; HUS: Hemolytic uremic syndrome; PT: prothrombin time; aPTT: activated partial thromboplastin time.",
"     <br>",
"      * The presence of many nucleated red cells suggests inflitrative disease of the marrow, such as occult metastatic cancer.",
"      <br>",
"       &bull; Disseminated intravascular coagulation is not typically present, but may be seen when there is diffuse tissue ischemia.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
